import React from "react";
import './TaskItem.css';

const TaskItem = (props) => {

    const delHandler = () => {
        props.onDelete(props.id);
    }

    return (
        <li className="goal-item" onClick={delHandler}>
            {props.children}
        </li>
    )
}

export default TaskItem
